a.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1243","type":"Line"},{"attributes":{"factors":["tcp://172.21.1.145:40685","tcp://172.21.1.145:40111","tcp://172.21.1.144:46659","tcp://172.21.1.144:41357","tcp://172.21.1.143:35039","tcp://172.21.1.143:35002","tcp://172.21.1.142:45753","tcp://172.21.1.142:43284"]},"id":"1157","type":"FactorRange"},{"attributes":{},"id":"1482","type":"AllLabels"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1495"},"group":null,"major_label_policy":{"id":"1496"},"ticker":{"id":"1379"}},"id":"1378","type":"DatetimeAxis"},{"attributes":{"below":[{"id":"1163"}],"center":[{"id":"1165"},{"id":"1168"}],"left":[{"id":"1166"}],"name":"bandwidth_worker_heatmap","renderers":[{"id":"1174"}],"right":[{"id":"1176"}],"sizing_mode":"stretch_both","title":{"id":"1153"},"toolbar":{"id":"1169"},"toolbar_location":null,"x_range":{"id":"1155"},"x_scale":{"id":"1159"},"y_range":{"id":"1157"},"y_scale":{"id":"1161"}},"id":"bk-bandwidth-worker-plot","subtype":"Figure","type":"Plot"},{"attributes":{"dimensions":"width"},"id":"1268","type":"PanTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1242"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1244"},"nonselection_glyph":{"id":"1243"},"view":{
